 sheet and profit and loss accounts can be generated as reports with different search options.'] = 'ගිණුම් ව්‍යුහයේ ප්‍රස්ථාරයක් නිර්මාණය කිරීමට සහ ප්‍රයිම් එන්ට්‍රි පොත් නිර්මාණය කිරීමට ඉඩ ලබා දේ. මූල්‍ය වර්ෂයක් සඳහා සහ ස්ථාන මත පදනම්ව අවශ්‍ය නම් ජර්නල් සටහන් එකතු කළ හැකිය. සැපයුම්කරු මිලදී ගැනීම සහ පාරිභෝගික විකුණුම් තොරතුරු සහ ඔවුන්ගේ ආපසු භාරදීම් තොරතුරු එකතු කළ හැකිය. ගෙවීම් මුදල්, චෙක්පත් සහ ක්‍රෙඩිට් කාඩ් ලෙස එකතු කළ හැකිය. චෙක්පත් පද්ධතිය තුළ ඉතා පහසුවෙන් හැසිරවිය හැකිය. අත්හදා බැලීමේ ශේෂය, ශේෂ පත්‍රය සහ ලාභ හා අලාභ ගිණුම් විවිධ සෙවුම් විකල්ප සහිත වාර්තා ලෙස ජනනය කළ හැකිය.';$lang['vehicle'] = 'vehicle';$lang['vehicle_code'] = 'vehicle_code';$lang['vehicle_number'] = 'vehicle_number';$lang['owner_type'] = 'owner_type';$lang['supplier'] = 'supplier';$lang['delivery_route_name'] = 'delivery_route_name';$lang['delivery route'] = 'delivery route';$lang['Delivery Route'] = 'Delivery Route';$lang['sales_terminal_code'] = 'sales_terminal_code';$lang['sales_terminal_name'] = 'sales_terminal_name';$lang['Sales Terminal'] = 'Sales Terminal';$lang['sales terminal'] = 'sales terminal';$lang['cash unit'] = 'cash unit';$lang['cash_unit_name'] = 'cash_unit_name';$lang['cash_value_index'] = 'cash_value_index';$lang['category_name'] = 'category_name';$lang['unit_name'] = 'unit_name';$lang['unit_conversion_name'] = 'unit_conversion_name';$lang['from_amount_not_valid'] = 'from_amount_not_valid';$lang['to_amount_not_valid'] = 'to_amount_not_valid';$lang['from_unit_required'] = 'from_unit_required';$lang['to_unit_required'] = 'to_unit_required';$lang['from_amount'] = 'from_amount';$lang['to_amount'] = 'to_amount';$lang['unit conversion'] = 'unit conversion';$lang['unit_conversion_already_in_use_cannot_modify'] = 'unit_conversion_already_in_use_cannot_modify';$lang['tax_name'] = 'tax_name';$lang['tax_percentage'] = 'tax_percentage';$lang['field should be a decimal number'] = 'field should be a decimal number';$lang['tax type'] = 'tax type';$lang['Tax Type already selected'] = 'Tax